import React, { useContext } from "react";
import { UserContext } from "../../../context/Contextusr";
import NavbarComp from "../../../components/navbar/NavbarComp";
import { Container, Card, Row, Col } from "react-bootstrap";
import styleprof from "./profile.module.css";
import iml from "../../../assets/icons/linux.png";
function ProfilePage() {
  const [state, dispatch] = useContext(UserContext);
  const data = JSON.parse(localStorage.getItem("userlogin"));
  console.log(state);
  return (
    <>
      <NavbarComp />
      <div className={styleprof.prf}>
        <Card className={styleprof.crd}>
          <Row>
            <Col md={6}>
              <h3>Personal Info</h3>
              <div className={styleprof.dta}>
                <p>{data?.fullname}</p>
                <span style={styleprof.tr}>fullname</span>
              </div>
            </Col>
            <Col md={6}>
              <div>
                <img src={iml} alt="odskfsd" width="90" height="150" />
              </div>
            </Col>
          </Row>
        </Card>
      </div>
    </>
  );
}

export default ProfilePage;
